import React from 'react';
// components
import Login from '../../components/login/Login';
import Register from '../../components/register/Register';

const Auth = () => {
	return (
		<div className="auth">
			<Login />
			<br />
			<br />
			<Register />
		</div>
	);
};

export default Auth;
